import React from 'react';
import styles from './Toolbar.module.css';

function Toolbar() {
  return (
    <div className={styles.inner}>
      <div className={styles.title}>
        CRUD
      </div>
      <div className={styles.toolbar}>
        회원가입
      </div>
      <div>
        |
      </div>
      <div className={styles.toolbar}>
        로그인
      </div>
    </div>
  );
}

export default Toolbar;
